#include <stdio.h>


int main() {
    long long int mock, f, k;
    int first = 0;
    int second = 1;
    int n = 0;
    int m = 0;
    int c;
    long long int y = 1;
    int z = 0;
    long long int arr[1000];
    char x[1000] = "";
    for (n = 0; n < 987; n++) {
        z = n;//ni koruyo
        for (f = 0; f < 13; f++) {
            c = x[n] - '0'; // asciiden int
            if (c == 0) {
                y = 1;//çarpaný korumak
                n = z;
                break;
            }
            y = c * y;
            n++;//sayý almak için

            if (f == 12) {
                arr[m] = y;
                m++;//sadece deðer aldýðýnda arrayde gözüksün
                y = 1;
                n = z;

            }
        }
        if (m==34){
            printf("sksk");
        }
    }
    for (k = 0; k <= n; ++k) {

        for (first=0; second <= m; second++) {

            if (arr[first] > arr[second]) {

                mock = arr[first];
                arr[first] = arr[second];
                arr[second] = mock;

            }
first++;
        }

    }

    printf("The numbers arranged in ascending order are given below \n");
    for (f = 0; f <= m; f++)
        printf("%lld\n", arr[f]);

    return 0;
}
